    false,nt"url": null,nt"notes": "This annual narrative report for Clarence
    Cannon NWR and Annada District outlines Refuge accomplishments during the 1988 calendar
    year. The report begins with a summary of the year's highlights and weather conditions.
    Land acquisition is covered. The report includes a planning section which discusses
    management planning and compliance with environmental and cultural resource mandates.
    Refuge administration is outlined; information about personnel, youth programs,
    manpower programs, volunteer programs, funding, and safety is given. Habitat management
    is also covered; subjects include wetlands, forests, croplands, fire management,
    and pest control. The wildlife section of the report discusses endangered and threatened
    species, waterfowl, marsh birds and waterbirds, shorebirds, raptors, animal control,
    and disease control. The public uses of the Refuge described in this report include
    interpretive programs and law enforcement. The equipment and facilities section
    of the report provides information about new construction, rehabilitation, equipment
    replacement, computer systems, and energy conservation. Cooperative programs are
    provided at the end.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
